import React, { useState } from 'react';
import { Card } from 'primereact/card';
import { InputText } from 'primereact/inputtext';
import { Password } from 'primereact/password';
import { Button } from 'primereact/button';
import { Message } from 'primereact/message';
import { Dropdown } from 'primereact/dropdown';
import { useAuth } from './AuthContext';

const Register: React.FC = () => {
  const [name, setName] = useState('');
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [role, setRole] = useState('user');
  const [error, setError] = useState('');
  const [loading, setLoading] = useState(false);
  const { register } = useAuth();

  const roleOptions = [
    { label: 'Korisnik', value: 'user' },
    { label: 'Administrator', value: 'admin' }
  ];

  const handleSubmit = async (e: React.FormEvent) => {
    e.preventDefault();
    setError('');
    setLoading(true);

    try {
      await register(name, email, password, role);
    } catch (err: any) {
      setError(err.message);
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="register-container">
      <div className="register-card">
        <div className="register-header">
          <div className="register-logo">
            <i className="pi pi-user-plus text-6xl text-primary"></i>
          </div>
          <h1 className="register-title">Kreiraj nalog</h1>
          <p className="register-subtitle">Registruj se u Uptiomio sistem</p>
        </div>

        <Card className="register-form-card">
          <form onSubmit={handleSubmit} className="register-form">
            <div className="field">
              <label htmlFor="name" className="field-label">Ime i prezime</label>
              <InputText
                id="name"
                value={name}
                onChange={(e) => setName(e.target.value)}
                className="field-input"
                placeholder="Unesite vaše ime"
                required
              />
            </div>

            <div className="field">
              <label htmlFor="email" className="field-label">Email adresa</label>
              <InputText
                id="email"
                type="email"
                value={email}
                onChange={(e) => setEmail(e.target.value)}
                className="field-input"
                placeholder="Unesite vaš email"
                required
              />
            </div>

            <div className="field">
              <label htmlFor="password" className="field-label">Lozinka</label>
              <Password
                id="password"
                value={password}
                onChange={(e) => setPassword(e.target.value)}
                className="field-input"
                placeholder="Kreirajte lozinku"
                required
                feedback={false}
                toggleMask
              />
            </div>

            <div className="field">
              <label htmlFor="role" className="field-label">Uloga</label>
              <Dropdown
                id="role"
                value={role}
                options={roleOptions}
                onChange={(e) => setRole(e.value)}
                className="field-input"
                placeholder="Izaberite ulogu"
              />
            </div>

            {error && (
              <Message severity="error" text={error} className="error-message" />
            )}

            <Button
              type="submit"
              label="Kreiraj nalog"
              className="register-button"
              loading={loading}
              size="large"
            />
          </form>
        </Card>
      </div>

      <style jsx>{`
        .register-container {
          min-height: 100vh;
          background: linear-gradient(135deg, #667eea 0%, #764ba2 100%);
          display: flex;
          align-items: center;
          justify-content: center;
          padding: 20px;
        }

        .register-card {
          width: 100%;
          max-width: 480px;
          text-align: center;
        }

        .register-header {
          margin-bottom: 2rem;
        }

        .register-logo {
          margin-bottom: 1rem;
        }

        .register-title {
          font-size: 2.5rem;
          font-weight: 700;
          color: white;
          margin: 0 0 0.5rem 0;
          text-shadow: 0 2px 4px rgba(0,0,0,0.3);
        }

        .register-subtitle {
          color: rgba(255,255,255,0.9);
          font-size: 1.1rem;
          margin: 0;
        }

        .register-form-card {
          box-shadow: 0 20px 40px rgba(0,0,0,0.1);
          border-radius: 16px;
          border: none;
        }

        .register-form {
          padding: 0;
        }

        .field {
          margin-bottom: 1.5rem;
          text-align: left;
        }

        .field-label {
          display: block;
          font-weight: 600;
          color: #374151;
          margin-bottom: 0.5rem;
          font-size: 0.9rem;
        }

        .field-input {
          width: 100%;
          padding: 0.75rem;
          border: 2px solid #e5e7eb;
          border-radius: 8px;
          font-size: 1rem;
          transition: all 0.2s;
        }

        .field-input:focus {
          border-color: #667eea;
          box-shadow: 0 0 0 3px rgba(102, 126, 234, 0.1);
        }

        .register-button {
          width: 100%;
          padding: 0.875rem;
          font-size: 1rem;
          font-weight: 600;
          border-radius: 8px;
          background: linear-gradient(135deg, #667eea 0%, #764ba2 100%);
          border: none;
          margin-top: 1rem;
        }

        .error-message {
          margin-bottom: 1rem;
        }
      `}</style>
    </div>
  );
};

export default Register;
